        <div className="how-to">
            <h1 className="title">How To</h1>
            <a href="#" style={{textDecoration: 'none'}}>
                <div className="sub-navigation">
                    <h2>Get Started</h2>
                </div>
            </a>
            
        </div>
    )
}
